import React, { useEffect } from 'react';
import Homepage from "./Homepage";
import Navbar from "./Navbar";
import Menu from "./Menu";
import background from './images/background.jpg'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import Footer from "./Footer";

import Book from "./Book";
import Location from "./location";
import Aboutus from "./Aboutus";
import OrderOnlinePage from "./OrderOnlinePage";
import ReviewsPage from './ReviewsPage';

import Starters from './Starters';
import Platters from './Platters';
import Mains from './Mains';
import Drinks from './Drinks';
import BookingConfirmation from './BookingConfirmation';
import OrderConfirmation from './OrderConfirmation';
import FAQPage from './FAQPage';
import NewsletterPage from './NewsletterPage';
import Menuoftheday from './Menuoftheday';
import FrenchHomepage from './frenchhomepage';
import FrenchAboutus from './FrenchAboutus';
function App() {
  useEffect(() => {
    document.body.style.backgroundImage = `url(${background})`;
    document.body.style.backgroundSize = "cover";
    document.body.style.backgroundRepeat = "no-repeat";
    document.body.style.backgroundAttachment = "fixed";
  }, []);
  return (
    <Router>
      <div className="App" >

        {/* <Navbar /> */}
        <div className="content">
          <Routes>
            <Route path="/" exact element={<Homepage />} />
            <Route path="/menu" exact element={<Menu />} />
            <Route path="/orderonlinepage" exact element={<OrderOnlinePage />} />
            <Route path="/book" exact element={<Book />} />
            <Route path="/reviewspage" exact element={<ReviewsPage />} />
            <Route path="/location" exact element={<Location />} />
            <Route path="/aboutus" exact element={<Aboutus />} />

            <Route path="/starters" exact element={<Starters/>} />
            <Route path="/platters" exact element={<Platters/>} />
            <Route path="/mains" exact element={<Mains/>} />
            <Route path="/drinks" exact element={<Drinks/>} />
            <Route path="/bookingconfirmation" exact element={<BookingConfirmation/>} />
            <Route path="/order-confirmation" exact element={<OrderConfirmation/>} />
            <Route path="/faqpage" exact element={<FAQPage/>} />
            <Route path="/newsletterpage" exact element={<NewsletterPage/>} />
            <Route path="/menuoftheday" exact element={<Menuoftheday/>} />
            <Route path="/frenchhomepage" exact element={<FrenchHomepage/>} />
            <Route path="/frenchaboutus" exact element={<FrenchAboutus/>} />

            <Route path="/frenchmenu" exact element={<Menu />} />
            <Route path="/frenchorderonlinepage" exact element={<OrderOnlinePage />} />
            <Route path="/frenchbook" exact element={<Book />} />
            <Route path="/frenchreviewspage" exact element={<ReviewsPage />} />
            <Route path="/frenchlocation" exact element={<Location />} />
            <Route path="/frenchstarters" exact element={<Starters/>} />
            <Route path="/frenchplatters" exact element={<Platters/>} />
            <Route path="/frenchmains" exact element={<Mains/>} />
            <Route path="/frenchdrinks" exact element={<Drinks/>} />
            <Route path="/frenchbookingconfirmation" exact element={<BookingConfirmation/>} />
            <Route path="/frenchorder-confirmation" exact element={<OrderConfirmation/>} />
            <Route path="/frenchfaqpage" exact element={<FAQPage/>} />
            <Route path="/frenchnewsletterpage" exact element={<NewsletterPage/>} />
            <Route path="/frenchmenuoftheday" exact element={<Menuoftheday/>} />

          </Routes>
        </div>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
